    fetch(
      `https://yts.mx/api/v2/list_movies.json?minimum_rating=8.8&sort_by=year`
    ).then();
  },[]);
  return (
    <div>
      {loading ? <h1>loading...</h1> : null}
      <h1>soheeflix</h1>
    </div>
  );
}

export default App;
